const handleErrors = async (response) => {
    let resp = await response
    if(!resp.ok){
        const errorMessage = {'error': resp.statusText}
        return errorMessage
    }   
}


export default async function getDish(url){
    const respuesta =  await fetch(url)
    const json = await respuesta.json()
    return json
}
